  if (season>="1") {
    return(
      <div>
      <h1 id="podtitle">{title}</h1>
      <h1 id="podsubtitle">Season:{season} Episode: {episode}</h1>
      </div>


    )  

  }
  if (episode>="1") {
  return (
    <div>
    <h1 id="podtitle">{title}</h1>
    <h1 id="podsubtitle">Episode: {episode}</h1>
    </div>



  );
  }
  }
}
